window.bookSummaryJSON = "<p><b>Puzzles need more than two pieces to come together.</b></p> <p>After surviving the massacre in Sol, Zaros decides it's time to join the rebels. Together with them, he's prepared to take revenge on the royal family and the nobles of the kingdom.</p> <p>However, allies may sometimes be more dangerous than enemies. And enemies may sometimes be the most worthy of allies.</p> <p>Follow the story as Zaros crosses paths with new enemies and allies, personally escorted by the god of death as he walks down the road fate has prepared for him. </p> <p>Be part of the legend. Listen to it now!</p>"; 
